import { actionTypes } from "../actions/me.action";

const initialState = {
  NAME: '',
  EMAIL: '',
  ID: '',
  LOADING: true
}

export default (state = initialState, {type, payload}) => {
  switch (type) {
    
    case 'INDEX_ME':
      return payload;

    default:
      return state;
  }
}
